import React from 'react';
import LiquidGauge from 'react-liquid-gauge';

function Skills() {
  const skillsData = [
    { label: "HTML", value: 95, circleColor: "#4CAF50", waveColor: "#45a049" },
    { label: "CSS", value: 90, circleColor: "#2196F3", waveColor: "#1976D2" },
    { label: "JS", value: 75, circleColor: "#FF9800", waveColor: "#FF5722" },
    { label: "Bootstrap", value: 95, circleColor: "#9C27B0", waveColor: "#673AB7" },
    { label: "PHP", value: 85, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "Wordpress", value: 95, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "AJAX", value: 75, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "MVC.Net", value: 75, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "Angular", value: 70, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "React", value: 50, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "Node", value: 50, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "Laravel", value: 55, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "CI", value: 60, circleColor: "#FF5722", waveColor: "#E64A19" },
    { label: "SEO", value: 75, circleColor: "#FF5722", waveColor: "#E64A19" },
  ];

  return (
    <div className="container-fluid software-skills-container-fluid">
      <div className="container">
        <h1>Skills</h1>
		<div className="row">
          {skillsData.map((skill, index) => (
              <div className="col-md-2 skill-section">
              <div key={index} style={{marginBottom: '10px' }}>
                <LiquidGauge
                  width={120}
                  height={120}
                  value={skill.value}
                  label={skill.label}
                  circleColor={skill.circleColor}
                  waveColor={skill.waveColor}
                />
                
              </div>
              <span>{skill.label}</span>
               </div>
            ))}
         
          
        </div>
      </div>
    </div>
  );
}

export default Skills;
